package face

import (
	"os"
	"strconv"
)

// IgnoredDist is the distance threshold for matching IgnoredEmbeddings.
var IgnoredDist = 0.86

func init() {
	if s := os.Getenv("PHOTOPRISM_FACE_IGNORED_DIST"); s == "" {
		// Keep default.
	} else if f, err := strconv.ParseFloat(s, 32); err != nil {
		log.Warnf("faces: PHOTOPRISM_FACE_IGNORED_DIST can not be parsed (0.1-1.5; -1 to disable)")
	} else if f < 0 {
		IgnoredDist = -1
		log.Debugf("faces: enabled matching of all ignored embeddings")
	} else if f >= 0.1 && f <= 1.5 {
		IgnoredDist = f
		log.Debugf("faces: changed matching distance for ignored embeddings to %f", IgnoredDist)
	} else {
		log.Warnf("faces: PHOTOPRISM_FACE_IGNORED_DIST is out of range (0.1-1.5; -1 to disable)")
	}
}

// Ignored tests whether the embedding is generally unsuitable for matching.
func (m Embedding) Ignored() bool {
	if IgnoredDist <= 0 {
		return false
	}

	return IgnoredEmbeddings.Contains(m, IgnoredDist)
}

